(153, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:70:\"Elementor 2.0 – We’re Reinventing WordPress Design, All Over Again\";s:7:\"excerpt\";s:222:\"Something new is about to arrive. In the coming weeks, we will gradually introduce Elementor version 2.0. Each release will focus on solving a substantial WordPress pain felt by users, yet never been dealt with before.​ \";s:7:\"created\";s:10:\"1519735624\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/upcoming-elementor-v2/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:79:\"Custom Fonts Are Here! Start Using Typekit & Self Hosted Fonts Inside Elementor\";s:7:\"excerpt\";s:98:\"Elementor introduces Custom Fonts - Upload your fonts quickly and easily & create unique websites.\";s:7:\"created\";s:10:\"1519050197\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:102:\"https://elementor.com/?p=10608&utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:83:\"Introducing The Call To Action Widget, Create Beautiful Boxes That Drive Engagement\";s:7:\"excerpt\";s:101:\"Now you can create interactive boxes that upgrade your website from average to exceptional in minutes\";s:7:\"created\";s:10:\"1518443145\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:109:\"https://elementor.com/call-to-action/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
