nd jQuery, too!<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18},\"typography_font_weight\":\"300\",\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"90\",\"bottom\":\"0\",\"left\":\"90\",\"isLinked\":false},\"_margin_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"50\",\"left\":\"0\",\"isLinked\":false},\"_padding_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"30\",\"bottom\":\"0\",\"left\":\"30\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
