951f65\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>We don\\u2019t nickel and dime you by charging for basic features. All jQuery animations are included and we only use the latest HTML5 web standards. Let\'s face it, you should not be slicing those PSDs when you have 100 other things you could be doing. We\'ll take your beautifully designed website and turn it into pixel perfect HTML\\/CSS markup so you don\'t have to. We are great at JavaScript and jQuery, too!<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18},\"typography_font_weight\":\"300\",\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"90\",\"bottom\":\"0\",\"left\":\"90\",\"isLinked\":false},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":16},\"_margin_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"50\",\"left\":\"0\",\"isLinked\":false},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"30\",\"bottom\":\"0\",\"left\":\"30\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4b11341\",\"elType\":\"section\",\"settings\":{\"background_background\":\"classic\",\"background_color\":\"#133547\"},\"elements\":[{\"id\":\"1555f3a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"be6b7ab\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/landing-one.ua\\/wp-content\\/uploads\\/2018\\/03\\/logo2-1.png\",\"id\":161}},\"elements\":[],\"widgetType\":\"image\"},{