(839, 214, '_elementor_data', '[{\"id\":\"4cea\",\"elType\":\"section\",\"settings\":{\"layout\":\"full_width\",\"background_background\":\"classic\",\"background_color\":\"#0983bc\"},\"elements\":[{\"id\":\"4cd5\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"4819\",\"elType\":\"widget\",\"settings\":{\"title\":\"PSD to HTML simplified\",\"align\":\"center\",\"title_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":58},\"typography_font_weight\":\"300\",\"_margin\":{\"unit\":\"px\",\"top\":\"100\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":45},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"de\",\"elType\":\"widget\",\"settings\":{\"title\":\"Get your site built in a breeze\",\"align\":\"center\",\"title_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":25},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":22},\"typography_font_weight\":\"300\",\"typography_text_transform\":\"uppercase\",\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"32bf\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Tired of project delays, bad project management and unreliable developers? Good website development is hard to find and now is not the time to mess around with poorly managed outsourced solutions. Our team of talented developers and engineers is here to help you save you tons of time coding that HTML file with better a PSD to HTML service. Just send us your design files and we will take care of the rest. We\\u2019ll make sure you are 100% happy with the results!<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18},\"typography_font_weight\":\"300\",\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"90\",\"bottom\":\"0\",\"left\":\"90\",\"isLinked\":false},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":16},\"_margin_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"30\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"30\",\"bottom\":\"0\",\"left\":\"30\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"7d8c\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>We don\\u2019t nickel and dime you by charging for basic features. All jQuery animations are included and we only use the latest HTML5 web standards. Let\'s face it, you should not be slicing those PSDs when you have 100 other things you could be doing. We\'ll take your beautifully designed website and turn it into pixel perfect HTML\\/CSS markup so you don\'t have to. We are great at JavaScript and jQuery, too!<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":18},\"typography_font_weight\":\"300\",\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"90\",\"bottom\":\"0\",\"left\":\"90\",\"isLinked\":false},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":16},\"_margin_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"50\",\"left\":\"0\",\"isLinked\":false},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_tablet\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"30\",\"bottom\":\"0\",\"left\":\"30\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4db6\",\"elType\":\"section\",\"settings\":{\"background_background\":\"classic\",\"background_color\":\"#133547\"},\"elements\":[{\"id\":\"6151\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"3bdb\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/landing-one.ua\\/wp-content\\/uploads\\/2018\\/03\\/logo2-1.png\",\"id\":161}},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"6678\",\"elType\":\"widget\",\"settings\":{\"title\":\"&copy; Copyright 2018\",\"align\":\"center\",\"title_color\":\"#f7f7f7\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Fira Sans\",\"typography_font_size\":{\"unit\":\"px\",\"size\":15},\"typography_font_weight\":\"300\",\"typography_text_transform\":\"uppercase\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false}]'),
