animations are included and we only use the latest HTML5 web standards. Let\'s face it, you should not be slicing those PSDs when you have 100 other things you could be doing. We\'ll take your beautifully designed website and turn it into pixel perfect HTML/CSS markup so you don\'t have to. We are great at JavaScript and jQuery, too!</p>', 'Home', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2018-03-18 20:21:01', '2018-03-18 20:21:01', '', 6, 'http://landing-one.ua/2018/03/18/6-revision-v1/', 0, 'revision', '', 0),
